;(function($){
	
	$.adaptive_append = function(e,o){
		this.options = o || {};
		this.el = $(e);
		this.init();
	};
    	

	
	var $adp = $.adaptive_append;
	$adp.fn = $adp.prototype = {
		adaptive_append: '1.0'
    };
	
	$adp.fn.extend = $adp.extend = $.extend;

    $adp.fn.extend({
        
    	init: function(){
			var $np,w;
			var r = this.options;
			var $c = this.el;
			if($c.length == 0) return false;
			var $p = $c.parent();
    		var f = function(){
				w = $(window).width();
				for(key in r){
						console.log('!!!',key+'<'+ w);
					if( key < w ){
						$np = $(r[key]);
						if($np.length>0){
							if($p != $np){
						console.log(r[key]);
						$p = $np;
							}
						}
					}
				}
				$c.appendTo($p);
			};
			f();
			var t=-1;
			$(window).ready(function(){
				$(window).resize(function(){
					if(t) clearTimeout(t);
					t = setTimeout(function(){f()},100);
				});
			});
    		
    	}
    });
    

					
					
    $.fn.adaptive_append = function(o){
    	
    	if (typeof o != 'string') {
            return this.each(function() {
                var instance = $(this).data('adaptive_append');
                if (instance) {
                    instance.init();
                } else {
                    $(this).data('adaptive_append', new $adp(this, o));
                }
            });
        }
    }; 
	
	
})(jQuery);
					
					
	
